    false,nt"url": null,nt"notes": "This annual narrative report for Innoko
    NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include fire management. The wildlife section of the report discusses waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries resources.
    The public uses of the Refuge described in this report include hunting, trapping,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction and equipment replacement.",nt"owner_org":
